{
  "description": "<h3>A police service for everyone</h3>\n<p>Leicestershire Police provides a policing service to the people of Leicester, Leicestershire and Rutland 24-hours a day, 365-days of the year.</p>\n<p>The area we are responsible for covers over 2,500 square kilometres (over 965 square miles) and has a population of nearly one million. There is a rich diversity of communities all with their own policing needs.</p>\n<p>Many steps have been taken to bring policing back into the very heart of local communities. This has included the replacement of older, larger or out-of-town police buildings with modern, self-contained local policing units in the very centre of local communities.</p>\n<p>Each of the 15 local policing units is headed by an inspector whose responsibility is to ensure that their area receives a 24-hour policing service.</p>\n<p>To help them provide this service they are supported by specialist departments such as the dog section, the scientific support department and the East Midlands air support unit.</p>\n<p>Rather than waiting for crimes to be committed, we are working more and more to plan operations and target criminals. Many of these operations, which are aimed at tackling specific problems, involve working in partnership with local residents and other agencies and have proved to be very successful.</p>\n<p>Over the years we have forged close working relationships with local communities, other organisations and agencies and we continue to develop and strengthen these partnerships, working together to fight crime and improve the quality of life for everyone.</p>",
